Actie / Horror
90 minuten

geregisseerd door Christopher Ray
met Carmen Electra, Charlie O' Connell en Brooke Hogan

Een schip van Semester at Sea wordt aangevallen door een gemuteerde haai met twee koppen en zinkt. De overlevenden begeven zich zo snel mogelijk naar een afgelegen koraaleiland. Maar wanneer het vloed wordt, zijn ze niet meer veilig voor de twee kaken van het vreselijke monster.



